function App() {
  return (
      <HelmetProvider>
          <Header />
          <div className="content-main">
              <Homepage />
          </div>
          <Footer />
      </HelmetProvider>

     //  <HelmetProvider>
     //        <RouterProvider router={router} />
     // </HelmetProvider>
  );
}

export default App;
